import '../styles/HeroSection.css'
function HeroSection(){
return(
    <div className='hero' >
        <div className='head' >Simplify Your Life with Our Todo App</div>
        <div className='body'>Stay organized and boost your productivity with our intuitive todo website. Experience a modern approach to task management that fits your lifestyle.</div>
        <div className='buttons'> 
            <button className='btn1'>Get Started</button>
             <button className='btn2'> Learn more</button>
        </div>
    </div>
)
}
export default HeroSection;
